import React, { Component } from "react";

export default class DisplayList extends Component {
  constructor(props) {
    super(props);
    this.filteredList = props.list;
  }

  itemStyle = { gap: 5 };

  render() {
    return (
      <div className="">
        {this.filteredList.map(item => (
          <div style={itemStyle}>
            <b>{item.name}</b>
            {item.size}
          </div>
        ))}
      </div>
    );
  }
}
